import classes from "./NavbarItem.module.css";

const NavBarItem = (props) => {
  return (
    <div className={classes.navbaritem && border}>
      {props.active}
      <div>
        <img className={classes.img} src={props.icon} />
      </div>
      <div>
        <p>&nbsp;{props.type}</p>
      </div>
    </div>
  );
};
export default NavBarItem;
